const transactions = [
    {
      id: 1,
      type: "Paiement",
      tontine: "Tontine Familiale",
      montant: 25000,
      date: "2 avril 2025",
      statut: "Complété"
    },
    {
      id: 2,
      type: "Réception",
      tontine: "Tontine Commerçants",
      montant: 500000,
      date: "25 mars 2025",
      statut: "Complété"
    },
    {
      id: 3,
      type: "Paiement",
      tontine: "Tontine Quartier",
      montant: 10000,
      date: "15 mars 2025",
      statut: "Complété"
    }
  ];
  
  export default transactions;
